:text: |
  Descendants of WILLIAMS, William and NELSON, Jane
  JWILLIAMS, William Leonard and WANKLYN, Sarah
  JWILLIAMS, Francis James Volkner (Frank) and STANDISH, Edith Frances
  WILLIAMS, Bevan Sydney and WILLIAMS, Mary Margaret Wilder (Bettie)
  02> WILLIAMS, Cyril Julian
  b 27.10.1932 d 28.07.1933
  Julian bd. at Havelock North Cemetery.
  03> WILLIAMS, Anthony Leonard m on 26.05.1962 to NORRIS, Dinah Allison
  b 24.08.1934
  b 05.02.1941
  Anthony b. at Napier and m. at St Peter's Church, Waipawa. Dinah, d/o Thomas
  Seton Norris and Rita Jessie Allison, b. at Wellington. Address: 5 Ritchie
  Place, Havelock North.
  Anthony was educated at Hereworth School and Christ's College. Until the end
  of 1994 he farmed "Hapua" station near Havelock North. He and Dinah operated a
  successful farmstay business from 1977 to 1991, hosting over 1,000 guests from
  all over the world. Following on from this Dinah was involved for several years until 1990 with the
  promotion of tourism to Hawkes Bay, for two years (1989-90) serving as Chairman of the Hawkes Bay
  Tourism Promotion Board.
  Anthony has been a trustee of the Henry and William Williams Commemorative Trust since 1968 and was
  Chairman from 1989 to 1997. He and Dinah were members of the organising committee for the Williams
  Family Reunion of 1973 and Dinah wrote an historical booklet for that event. Anthony also served for
  many years on Henry and William Williams Memorial Trust.
  Dinah has been involved in local government since 1989. She served for six year on the Hawkes Bay
  Regional Council and has just been elected for a second term on the Hastings District Council. She
  also served on the New Zealand Casino Control Authority from 1990 to 1996.
  Anthony and Dinah moved to Havelock North at the end of 1994.
  01> WILLIAMS, Belinda
  b 09.07.1963 d 26.07.1966
  Belinda b. at Hastings and bd. at Elsthorpe Cemetery.
  02> WILLIAMS, Jeremy William Thomas m on 18.03.1995 to COUSENS, Andrea
  b 31.05.1965
  b ** ** ****
  Jeremy b. at Hastings. Andrea, d/o Graeme Charles Cousens and Margaret Rose Tate, b, at Havelock
  North. Address: 16 Mallard Grove, Churton Park, Wellington,
  Jeremy completed a Degree in Agricultural Science and a Diploma in Business Studies from Massey
  University. Following the completion of his studies, he travelled overseas for two years. Upon
  returning to New Zealand, he worked in the meat industry and then the horticultural industry with
  Yates New Zealand Ltd as National Sales Manager. Presently he works with New Zealand Post in
  Wellington as a Strategic Account Manager.
  Andrea attended Massey University in 1988, studying Psychology and Education. She then travelled
  overseas for two years overseas and returned to New Zealand to further her studies, subsequently
  completing a Diploma in Business Studies(Training and Development). She worked for Toyota New
  Zealand for several years. Currently she works for Ockwell Ltd in Wellington as a Training and
  Development Consultant specialising in developing training programmes for clients.
  03> WILLIAMS, Amanda Jane m on 07.03.1992 to WALLACE, Duncan Ross
  b 30.09.1966
  b 13.02.1967
  Amanda b. at Hastings. Duncan, s/o lan and Noreen Wallace.
  Amanda attended Massey University (BHort, Dip Bus Studies, 1989) then
  worked as personnel manager with Weddel NZ Ltd in Wellington. She then
  joined Trust Bank in Hastings, then moved to Hamilton where she worked for
  Health Waikato as a remuneration officer. After she and Duncan moved back
  to Wellington, she worked for National Insurance Company where she was a
  senior human resources consultant until resigning in 1997 to have their first child.
  Duncan attended Otago Boys' High School and Otago University. He was an accounting officer with
  Jacques Martin NZ Ltd. He then joined U-Bix NZ where he is now a senior sales consultant in
  Wellington. He is keenly interested in rugby and cricket.
